import './SignIn.css';
import React from 'react';
import Signlogo from './img/blue_logo.PNG';
import signIn from './img/signIn.PNG';
import cat1 from './img/SignIn1.png';
import cat2 from './img/SignIn2.PNG';
import cat3 from './img/SignIn3.PNG';
import cat4 from './img/SignIn4.PNG';
import { BrowserRouter as Router,Link } from 'react-router-dom';//BrowserRouter
import { Routes ,Route } from 'react-router-dom';
import {useNavigate} from 'react-router-dom';
import {useState} from "react";
import axios from 'axios';
import { useCookies } from 'react-cookie';
import { onLogin } from "./cookie.js";
import { setAuthToken } from "./utils";

const PreTimeTable=()=> {

    let navigate = useNavigate();
    const [cookies, setCookie] = useCookies(['token']);
    const [error, setError] = useState(false);

    function PreTimeTable() {
      const [student_id, setStudent_id] = useState("");
      const [password, setPassword] = useState("");
      const [waiting, setWaiting] = useState(false);
      const [responseStatus, setResponseStatus] = useState("");
      const navigate = useNavigate();
      const handleStudent_idChange = (event) => {
        setStudent_id(event.target.value);
      };

      const handlePasswordChange = (event) => {
              setPassword(event.target.value);
      };
      const handleSubmit = (e) => {
        e.preventDefault();
        //alert(`The name you entered was: ${student_id}`);
        setWaiting(true);
        const formData = {
                        studentID: student_id,
                        password: password,
                      };
                      fetch('/login', {
                            method: 'POST',
                            headers: {
                              'Content-Type': 'application/json'
                            },
                            body: JSON.stringify(formData)
                          })
                          .then(response => {
                            console.log(response.status);
                            if(response.status==200){
                              navigate("/homePage");
                            }
                            else if(response.status==400){
                              alert("輸入錯誤");
                              setError(true);
                            }
                            else if(response.status==201){
                              navigate('/nickName', {
                                state: {
                                  studentID: student_id,
                                }
                              });
                            }
                            console.log(response);
                            return response.json();
                          })
                          .then(data => {
                            onLogin(student_id);
                            console.log(data.token);//token
                            setAuthToken(data.token);
                          })
                          .catch(error => {
                            console.error(error);
                          });
        
         
      }
      return (
        
        <div className="PreTimeTable">    
            
 
        </div>
      );
    }

    return (

           
                <Routes>
                    <Route path="/" element={<PreTimeTable />} />
                </Routes>
             
    );
}

export default PreTimeTable;
